import Facebook from "../assets/facebook.svg";
import Twitter from "../assets/twitter.svg";
import Instagram from "../assets/instagram.svg";

const socials = [
    {
        id: 0,
        name: "Facebook",
        src: {...Facebook},
        width: "9",
        height: "16",
    },
    {
        id: 1,
        name: "Twitter",
        src: Twitter,
        width: "18",
        height: "16",
    },
    {
        id: 2,
        name: "Instagram",
        src: Instagram,
        width: "18",
        height: "18",
    }
];

export default socials;
